import { Button } from "react-bootstrap";
import { useNavigate } from "react-router";
import React from "react";

function homeButton() {
    const { navigation } = useNavigate();
    <Button className='homeButton'
    onClick={() => navigate("/")}>
        Home
    </Button>
}

export default homeButton;
